import {Axios} from "@/services/axios.js"

export default{
    async RegisterUser(data){
        try {
            return await Axios.post('users',data)
        } catch (error) {
            return false
        }
    },
    async LoginUser(data){
        try {
            await Axios.post('auth/login',data)
            .then(response => {
                let data;
                data= response.data
                return data;
            })
            .catch(e => {
                return false
            })
        } catch (error) {
            return false
        }
    }
}
